import { Component, Vue } from 'vue-property-decorator';
import PictureDetection from '@/views/pictureDetection/Main.vue';
import { routes } from '@/router';

@Component({
  components:{
    PictureDetection
  }
})
export default class Home extends Vue {
  private navs: any[] = [];

  private mounted() {
    this.navs = routes[0].children;
  }
}
